import GamePage from "./GamePage";
import NavBar from "./NavBar";
import Home from "./Home";
import { Switch, Route, Redirect, withRouter } from "react-router-dom";

function App() {


    return (
        <div>
            <NavBar />
            <Switch>
                <Route path="/" component={GamePage} />
            </Switch>
        </div>
    );
}

export default App;
